import React from 'react';

const Header = () => {
  return (
    <header className="relative bg-gradient-to-r from-blue-500 to-purple-500 h-16 flex items-center justify-between px-6 backdrop-blur-md bg-opacity-30">
      <div className="absolute inset-0 -z-10 bg-cover bg-center" style={{ backdropFilter: blur }}></div>
      <nav className="flex space-x-4">
        <a href="#home" className="text-white font-semibold hover:underline">Home</a>
        <a href="#about" className="text-white font-semibold hover:underline">About</a>
        <a href="#resume" className="text-white font-semibold hover:underline">Resume</a>
      </nav>
    </header>
  );
};

export default Header;
